import React from 'react';
import Expendelitem from './Expenselitem';
import "./ExpensesLis.css";
 const ExpensesList = (props) => {

  return (
   <ul>
     {props.items.map( expense => {
      <Expendelitem 
      key= {expense.id}
      title={expense.title} 
      data={expense.data}
      amount={expense.amount} 
       />

     })
      }

   </ul>
  )
}
export default ExpensesList;
